import React from 'react'; // Import React



function Project(projectData) {
  const project = document.createElement('div');
  project.classList.add('project'); // Add your desired class for project styling

  // Create image element
  const image = document.createElement('img');
  image.src = projectData.imageUrl;
  image.alt = projectData.title;
  project.appendChild(image);

  // Create title element
  const title = document.createElement('h3');
  title.textContent = projectData.title;
  project.appendChild(title);

  // Create description element
  const description = document.createElement('p');
  description.textContent = projectData.description;
  project.appendChild(description);

  // Create more elements based on your project data (technologies, accomplishments, etc.)
  // ...

  // Create link element
  const link = document.createElement('a');
  link.href = projectData.link;
  link.target = '_blank';
  link.rel = 'noopener noreferrer';
  link.textContent = 'View Project';
  project.appendChild(link);

  return project;
}

export default Project;
